import React from 'react';
import { HomeContainer } from './styles';
import { Box } from '../../components/containers/styles';
import { Space } from '../../components/space';
import { Link } from 'react-router-dom';

export const Home = () => {
  return (
    <HomeContainer>
      <Space height={200} />
      <Box center={true}>
        <h1>Home</h1>
      </Box>
      <Link to="/Browse">
        <h2>Browse</h2>
      </Link>
    </HomeContainer>
  );
};
